import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import NewsItem from './Components/NewsItem';


export default class App extends Component {

  render() {
    return (
      <div>
      <Router>
        <Navbar />


        <Switch>
          <Route path="/"><News pageSize={8} counry="in" category="genral"/></Route>
          <Route path="/business"><News pageSize={8} counry="in" category="business"/></Route>
          <Route path="/entertainment"><News pageSize={8} counry="in" category="entertainment"/></Route>
          <Route path="/health"><News pageSize={8} counry="in" category="health"/></Route>
          <Route path="/science"><News pageSize={8} counry="in" category="science"/></Route>
          <Route path="/sports"><News pageSize={8} counry="in" category="sports"/></Route>
          <Route path="/technology"><News pageSize={8} counry="in" category="technology"/></Route>
        </Switch>

      </Router>
      </div>
    )
  }
}
